import React, { useState, useEffect } from 'react';
import { storiesAPI } from '../services/api';
import { 
  Plus, 
  Edit, 
  Trash2, 
  Play, 
  Sparkles, 
  Clock, 
  Target,
  MessageSquare,
  Filter,
  Search,
  RefreshCw,
  Star,
  ArrowRight
} from 'lucide-react';
import { format } from 'date-fns';
import toast from 'react-hot-toast';

const Stories = () => {
  const [stories, setStories] = useState([]);
  const [loading, setLoading] = useState(true);
  const [filter, setFilter] = useState('all');
  const [searchTerm, setSearchTerm] = useState('');
  const [refiningStory, setRefiningStory] = useState(null);
  const [generatingStarters, setGeneratingStarters] = useState(null);

  useEffect(() => {
    loadStories();
  }, [filter]);

  const loadStories = async () => {
    try {
      const response = await storiesAPI.getStories(1, 50, filter === 'all' ? undefined : filter);
      setStories(response.data.stories || []);
    } catch (error) {
      console.error('Error loading stories:', error);
      toast.error('Failed to load stories');
    } finally {
      setLoading(false);
    }
  };

  const handleRefineStory = async (storyId, tone, duration) => {
    setRefiningStory(storyId);
    try {
      const response = await storiesAPI.refineStory(storyId, { tone, duration });
      toast.success('Story refined successfully!');
      loadStories();
    } catch (error) {
      console.error('Error refining story:', error);
      toast.error('Failed to refine story');
    } finally {
      setRefiningStory(null);
    }
  };

  const handleGenerateStarters = async (storyId) => {
    setGeneratingStarters(storyId);
    try {
      const response = await storiesAPI.getConversationStarters(storyId);
      toast.success('Conversation starters generated!');
      // You could show these in a modal or expand the story card
      console.log('Conversation starters:', response.data.conversation_starters);
    } catch (error) {
      console.error('Error generating starters:', error);
      toast.error('Failed to generate conversation starters');
    } finally {
      setGeneratingStarters(null);
    }
  };

  const handleDeleteStory = async (storyId) => {
    if (!window.confirm('Are you sure you want to delete this story?')) {
      return;
    }

    try {
      await storiesAPI.deleteStory(storyId);
      toast.success('Story deleted successfully');
      loadStories();
    } catch (error) {
      console.error('Error deleting story:', error);
      toast.error('Failed to delete story');
    }
  };

  const filteredStories = stories.filter(story => 
    story.title.toLowerCase().includes(searchTerm.toLowerCase()) ||
    story.content.toLowerCase().includes(searchTerm.toLowerCase())
  );

  const toneColors = {
    casual: 'bg-green-100 text-green-800',
    funny: 'bg-yellow-100 text-yellow-800',
    thoughtful: 'bg-blue-100 text-blue-800',
    'self-deprecating': 'bg-purple-100 text-purple-800',
    dramatic: 'bg-red-100 text-red-800'
  };

  if (loading) {
    return (
      <div className="max-w-6xl mx-auto px-4 sm:px-6 lg:px-8 py-8">
        <div className="animate-pulse">
          <div className="h-8 bg-gray-200 rounded w-1/4 mb-6"></div>
          <div className="grid grid-cols-1 md:grid-cols-2 lg:grid-cols-3 gap-6">
            {[1, 2, 3, 4, 5, 6].map((i) => (
              <div key={i} className="h-64 bg-gray-200 rounded-lg"></div>
            ))}
          </div>
        </div>
      </div>
    );
  }

  return (
    <div className="max-w-6xl mx-auto px-4 sm:px-6 lg:px-8 py-8">
      {/* Header */}
      <div className="flex items-center justify-between mb-8">
        <div>
          <h1 className="text-3xl font-bold text-gray-900">Stories</h1>
          <p className="text-gray-600 mt-1">
            Your conversation stories, refined and ready to share
          </p>
        </div>
        <button
          onClick={() => window.location.href = '/journal'}
          className="btn-primary flex items-center"
        >
          <Plus className="w-5 h-5 mr-2" />
          Create from Journal
        </button>
      </div>

      {/* Filters and Search */}
      <div className="flex flex-col sm:flex-row gap-4 mb-8">
        <div className="flex-1">
          <div className="relative">
            <Search className="absolute left-3 top-1/2 transform -translate-y-1/2 text-gray-400 w-5 h-5" />
            <input
              type="text"
              placeholder="Search stories..."
              value={searchTerm}
              onChange={(e) => setSearchTerm(e.target.value)}
              className="input-field pl-10"
            />
          </div>
        </div>

        <div className="flex items-center space-x-2">
          <Filter className="w-5 h-5 text-gray-400" />
          <select
            value={filter}
            onChange={(e) => setFilter(e.target.value)}
            className="input-field"
          >
            <option value="all">All Stories</option>
            <option value="casual">Casual</option>
            <option value="funny">Funny</option>
            <option value="thoughtful">Thoughtful</option>
            <option value="self-deprecating">Self-deprecating</option>
            <option value="dramatic">Dramatic</option>
          </select>
        </div>

        <button
          onClick={loadStories}
          className="btn-secondary flex items-center"
        >
          <RefreshCw className="w-4 h-4 mr-2" />
          Refresh
        </button>
      </div>

      {/* Stories Grid */}
      {filteredStories.length > 0 ? (
        <div className="grid grid-cols-1 md:grid-cols-2 lg:grid-cols-3 gap-6">
          {filteredStories.map((story) => (
            <div key={story.id} className="card-hover">
              <div className="flex items-start justify-between mb-3">
                <h3 className="text-lg font-semibold text-gray-900 line-clamp-2">
                  {story.title}
                </h3>
                <span className={`px-2 py-1 text-xs rounded-full ${toneColors[story.tone] || 'bg-gray-100 text-gray-800'}`}>
                  {story.tone}
                </span>
              </div>

              <p className="text-gray-600 text-sm mb-4 line-clamp-3">
                {story.content}
              </p>

              <div className="flex items-center justify-between text-xs text-gray-500 mb-4">
                <div className="flex items-center space-x-3">
                  <span className="flex items-center">
                    <Clock className="w-3 h-3 mr-1" />
                    {story.duration_seconds}s
                  </span>
                  {story.times_told > 0 && (
                    <span className="flex items-center">
                      <Target className="w-3 h-3 mr-1" />
                      {story.times_told}
                    </span>
                  )}
                  {story.success_rating && (
                    <span className="flex items-center">
                      <Star className="w-3 h-3 mr-1" />
                      {story.success_rating}/10
                    </span>
                  )}
                </div>
                <span>
                  {format(new Date(story.created_at), 'MMM d')}
                </span>
              </div>

              <div className="flex items-center justify-between">
                <div className="flex items-center space-x-2">
                  <button
                    onClick={() => handleRefineStory(story.id, story.tone, story.duration_seconds)}
                    disabled={refiningStory === story.id}
                    className="p-2 text-primary-600 hover:text-primary-700 hover:bg-primary-50 rounded-lg transition-colors duration-200"
                    title="Refine story"
                  >
                    {refiningStory === story.id ? (
                      <div className="animate-spin rounded-full h-4 w-4 border-b-2 border-primary-600"></div>
                    ) : (
                      <Sparkles className="w-4 h-4" />
                    )}
                  </button>

                  <button
                    onClick={() => handleGenerateStarters(story.id)}
                    disabled={generatingStarters === story.id}
                    className="p-2 text-green-600 hover:text-green-700 hover:bg-green-50 rounded-lg transition-colors duration-200"
                    title="Generate conversation starters"
                  >
                    {generatingStarters === story.id ? (
                      <div className="animate-spin rounded-full h-4 w-4 border-b-2 border-green-600"></div>
                    ) : (
                      <MessageSquare className="w-4 h-4" />
                    )}
                  </button>

                  <button
                    onClick={() => window.location.href = `/practice?story=${story.id}`}
                    className="p-2 text-blue-600 hover:text-blue-700 hover:bg-blue-50 rounded-lg transition-colors duration-200"
                    title="Practice this story"
                  >
                    <Play className="w-4 h-4" />
                  </button>
                </div>

                <div className="flex items-center space-x-1">
                  <button
                    onClick={() => handleDeleteStory(story.id)}
                    className="p-2 text-red-600 hover:text-red-700 hover:bg-red-50 rounded-lg transition-colors duration-200"
                    title="Delete story"
                  >
                    <Trash2 className="w-4 h-4" />
                  </button>
                </div>
              </div>
            </div>
          ))}
        </div>
      ) : (
        <div className="text-center py-12">
          <MessageSquare className="w-16 h-16 text-gray-300 mx-auto mb-4" />
          <h3 className="text-lg font-medium text-gray-900 mb-2">
            {searchTerm ? 'No stories found' : 'No stories yet'}
          </h3>
          <p className="text-gray-600 mb-6">
            {searchTerm 
              ? 'Try adjusting your search terms'
              : 'Create stories from your journal entries to start building your conversation toolkit'
            }
          </p>
          {!searchTerm && (
            <button
              onClick={() => window.location.href = '/journal'}
              className="btn-primary flex items-center mx-auto"
            >
              <Plus className="w-5 h-5 mr-2" />
              Create your first story
            </button>
          )}
        </div>
      )}

      {/* Quick Actions */}
      {stories.length > 0 && (
        <div className="mt-12 bg-gradient-to-r from-primary-50 to-secondary-50 rounded-xl p-6">
          <h3 className="text-lg font-semibold text-gray-900 mb-4">Quick Actions</h3>
          <div className="grid grid-cols-1 md:grid-cols-3 gap-4">
            <button
              onClick={() => window.location.href = '/practice'}
              className="flex items-center p-4 bg-white rounded-lg hover:shadow-md transition-shadow duration-200"
            >
              <Play className="w-6 h-6 text-blue-600 mr-3" />
              <div className="text-left">
                <div className="font-medium text-gray-900">Practice Mode</div>
                <div className="text-sm text-gray-600">Rehearse your stories</div>
              </div>
              <ArrowRight className="w-5 h-5 text-gray-400 ml-auto" />
            </button>

            <button
              onClick={() => window.location.href = '/journal'}
              className="flex items-center p-4 bg-white rounded-lg hover:shadow-md transition-shadow duration-200"
            >
              <Plus className="w-6 h-6 text-green-600 mr-3" />
              <div className="text-left">
                <div className="font-medium text-gray-900">New Story</div>
                <div className="text-sm text-gray-600">Create from journal</div>
              </div>
              <ArrowRight className="w-5 h-5 text-gray-400 ml-auto" />
            </button>

            <button
              onClick={loadStories}
              className="flex items-center p-4 bg-white rounded-lg hover:shadow-md transition-shadow duration-200"
            >
              <RefreshCw className="w-6 h-6 text-purple-600 mr-3" />
              <div className="text-left">
                <div className="font-medium text-gray-900">Refresh All</div>
                <div className="text-sm text-gray-600">Update your stories</div>
              </div>
              <ArrowRight className="w-5 h-5 text-gray-400 ml-auto" />
            </button>
          </div>
        </div>
      )}
    </div>
  );
};

export default Stories;
